values:
You know, I hadn't really bee nall too aware about the whole Jackie thing until today. It never really sunk in. I never really could grasp the fact that one of our beloved and invulnerable class could possibly have been smacked down by something like this...I've never really known Jackie all too well.....And I regret that so much now.....There is one thing I do know about her though, and anybody who sees her knows this: You never see her without a smile on her face. That in itself is something special. DAMNIT!!! I really wish I was 18!!!! I would go get tested for a transplant. Yes, I know you can get a blood test and crap when you're 17 with parental consent, but even if your marrow matches what then!? It's not like, oh! You're 17, but you're a match? Just tell everyone you're 18...." NO! It's more like "Ok, so you are a match. now wait 11 monthes until you are legally capable of donating! Have a nice PAIN AND FEAR FILLED 11 Freakin' monthes! I really want to help....in absolutely any way, shape, or form, that I can...even if I can't, I still wanna try.....
On top of all of this, or rather, along with this, or maybe they aren't even related but....TOMORROW IS OUR LAST DAY OF SCHOOL!!!!!!!!!!And I have to end it with chemistry -_-;;


Prayers and <3 for Jackie!
